:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  VDAVIES, Marianne Caroline and BUSBY, William
  JBUSBY, Beatrice and JEFFERD, Charles Toms
  BUSBY, Beatrice and JEFFERD. Charles Toms (cont...)
  farm. Beatrice was known as an accomplished horsewoman.
  01> JEFFERD, John Busby (Jack) m on 23.07.1947 to REEVES, Margaret Shirley
  Leigh
  b 19.07.1918 d 11.09.1981
  b 23.04.1924
  Jack b. at Tokomaru Bay, m, at Gisborne and d. at Tokomaru bay. Margaret, d/o
  Andrew Ernest Reeves and Edith Cantrell Donald, b. at Auckland. Address: 2
  Lloyd George Road, Wainui, Gisborne.
  Jack was educated at home then Huntley School and Wanganui Collegiate School.
  He farmed "Mangarakai" station, Tokomaru Bay and saw 42 years service overseas
  with the 2nd NZEF 5th Field Regiment Artillery during WW2. He was a good
  all-round sportsman and horseman.
  Margaret supervised the Uawa Farm Trust (Reeves Estate) at Tolaga Bay from 1966 to 1984. Her interests
  include Maori language and culture and she is a palliative care volunteer, a keen conservationist and
  enjoys singing.
  Refer to "The Reeves of Tolaga Bay and Their Descendants" published by Evagean Publishing in 1992 for
  records of Margaret's family.
  01> JEFFERD, Angela Leigh m on 22.03.1969 to FLETCHER, Reid
  b 07.10.1948
  b 08.06.1947
  Leigh b. at Gisborne and m, at Tokomaru Bay. Reid, slo Donald Frank Fletcher and Patricia Mary
  Smith, b. in England. Address: Waitaria Partnership, 32 Tineroto Road, RD 2, Gisborne.
  Leigh and Reid are horticultural farmers.
  01> FLETCHER, Jane Margaret
  b 06.10.1970
  Jane b, at Waipukurau, She graduated LLB from Otago University then worked as a lawyer for
  Rishworth Wall and Mathieson for several years. She is now overseas.
  02> FLETCHER, Melanie
  b 30.04.1972 d 30.04.1972
  Melanie b. and d. at Gisborne.
  03> FLETCHER, Sarah
  b 30.04.1972 d 30.04.1972
  Sarah b. and d. at Gisborne.
  04> FLETCHER, Andrew Donald
  b 06.06.1973
  Andrew b. at Waipukurau. He works in agriculture and is now overseas.
  65> FLETCHER, Mark Reid
  b 03.11.1975
  Mark b. at Gisborne. He graduated from Lincoln University with a Bachelor of Landscape
  Architecture in 1997.
  02> JEFFERD, Patricia Anne m on 27.02.1982 to GIRLING - BUTCHER, Nicholas
  John
  b 29.08.1950
  b 27.06.1950
  Nicholas, s/o Dr Martin Girling-Butcher and Elizabeth Espagne. Address: "Ihunui", PO Box 142,
  Tolaga Bay.
  Patricia and Nicholas are farmers and have a small Cashmere garment business.
